import React from 'react';
import "./User_account.css";
import DefaultUser from './default-user.png';

let name_user = "User"
let surname = "Super"
let nickname = "ProGamer"


export default function Account() {
  return(
    <div className='Account'>
        <h1 className='Hello_user'>Hello, {name_user}</h1>
        <div className='User_data'>
            <img src={DefaultUser} alt="DefUser" className="DefaultUser" />
            <span className='Name'>Name: {name_user}</span>
            <span className='Surname'>Surname: {surname}</span>
            <span className='Name'>Name: {name_user}</span>


        </div>
    </div>

  );
}
